const e="Willkommen im Schularchive-Wiki",n="",i="db.json",s="http://schularchive.bbf.dipf.de/index.php/Special:URIResolver/",t={title:"title",img:["image"],property:""},r="",o=["de"],c={de:`Dieses Wiki dient zur Sammlung schulgeschichtlichen Wissens. Verzeichnet werden allgemeine Angaben sowie die Standorte von Quellen und Materialien, die über die Geschichte einzelner Schulen und Lehrerbildungseinrichtungen im deutschsprachigen Raum Auskunft geben. Das können das eigene Archiv der Schule, aber auch externe Archive oder die Sammlungen von Schulmuseen sein. 
Das Wiki soll eine Plattform werden, die verschiedene schulhistorische Interessen bedient. So können beispielsweise Schularchivar*innen hier die Bestände ihres Schularchivs verzeichnen und damit Bildungshistoriker*innen das Auffinden von Quellen für deren Arbeit erleichtern. Das Wiki wird betrieben von der <strong>BBF | Bibliothek für Bildungsgeschichtliche Forschung</strong> des <strong>DIPF | Leibniz-Institut für Bildungsforschung und Bildungsinformation</strong>, dem <strong>Informationszentrum Bildung des DIPF</strong> und dem <strong>Lehrstuhl Historische Bildungsforschung an der Ruhr-Universität Bochum</strong>.`},l=30,a=[],d="Lorem ipsum dolor sit amet.",u="",h={title:e,api:n,local:i,url:s,paths:t,publicSite:r,languages:o,description:c,batch:l,mainCategories:a,descriptionSeo:d,imageSeo:u},g=Object.freeze(Object.defineProperty({__proto__:null,api:n,batch:l,default:h,description:c,descriptionSeo:d,imageSeo:u,languages:o,local:i,mainCategories:a,paths:t,publicSite:r,title:e,url:s},Symbol.toStringTag,{value:"Module"}));export{d as a,g as c,c as d,u as i,o as l,t as p,e as t,s as u};
